  return (
    <Col size={12} sm={6} md={4}>
      <div className="proj-imgbx">
        <img src={imgUrl} />
        <div className="proj-txtx">
          <h4>{title}</h4>
          <span>{description}</span>
          <div className = "link">
          <button className="vvd"><Link to={{
          pathname: "/projects"}}><span>Join Us</span></Link></button>
          </div>
        </div>
      </div>
    </Col>
  )
}
